import React from 'react';
import Answerset from './Problem';

// /System. 관리자 페이지라 치고 시도했으나...

class System extends React.Component {

    render() {
        return (
            <div className="System">
                <h1>System</h1>
                {Answerset.map(current =>
                    {current.Sid}
                )}
            </div>
        )
    }
}

export default System;
